import React, { Component } from 'react';
import Styled from 'styled-components';

const Wapper = Styled.div`
    width:500px;
    height:300px;
    margin:auto;
    border:1px solid #ccc;
`;

class slider extends Component {
    render() {
        return (
            <div>
                <Wapper>

                </Wapper>
            </div>
        );
    }
}

export default slider;
